const MainContact = () => {
	return (
		<div className='container'>
			<div className='row'>
				<h2 className='section-title'>Kontakt</h2>
			</div>
			<div className='row'>
				<div className='col-lg-6'>
					<h1>Contact Data</h1>
				</div>
				<div className='col-lg-6 '>
					<iframe
						className='map-box'
						width='600'
						height='450'
						src={`https://www.google.com/maps/embed/v1/place?key=${process.env.MAP_API}&q=Dr.med.dent.+Harry+Klinger`}
						allowFullScreen
					></iframe>
				</div>
			</div>
		</div>
	);
};

export default MainContact;
